create table TB_HIST_SALDO_CB
(
    co_hist_saldo_cb  int auto_increment,
    dt_cadastro       datetime     null,
    tp_fluxo          int(1)       null comment '1 - Entrada / 2 - Saída',
    nu_valor_pago     float(12, 2) null,
    nu_saldo          float(12, 2) null,
    ds_observacao     text         null,
    co_conta_bancaria int          not null,
    co_usuario        int(10)      not null,
    primary key (co_hist_saldo_cb, co_conta_bancaria, co_usuario)
);

